import React from 'react';
import './LoginForm3.css';

function LoginForm3() {
    return (
        <div className="loginform3">
            <h2>Form 3</h2>
            <div>
                <form>
                    <h3>Welcome</h3>
                </form>
            </div>
        </div>
    )
}

export default LoginForm3
